**Component Description: User Profile Component**

In a web application designed for managing user accounts, the User Profile Component is responsible for displaying and editing user information. This component allows users to view their profile details, such as name, email, profile picture, and bio. Additionally, it provides functionality for users to update their information and upload a new profile picture.

**Functionality Requirements:**
1. Display user information fetched from a user service.
2. Allow users to edit their profile details.
3. Implement file upload functionality for profile pictures.
4. Validate user input before submission.
5. Provide feedback to users upon successful or failed updates.

**Design Requirements:**
1. Responsive design that works on both desktop and mobile devices.
2. User-friendly interface with clear labels and instructions.
3. Use of Angular Material for UI components to ensure consistency and accessibility.

**Performance Requirements:**
1. Efficient data fetching using Angular's HttpClient.
2. Minimize the number of API calls by caching user data.
3. Optimize image uploads to reduce load times.

